import React from 'react';
import "./App.css";

function App() {
  return (
    <div className="App">
     <form action="APPEL" method="post" 
            className="form">
        <button type="submit">Connected?</button>
      </form>

      <p>Hello world</p>

    </div>
  );
}

export default App;
